import React from 'react';
import { Table, Badge } from 'antd';

const ApprovalsTable = ({ approvals }) => {
    const columns = [{
            title: 'Approval ID',
            dataIndex: 'id',
            key: 'id',
        },
        {
            title: 'Request ID',
            dataIndex: 'requestId',
            key: 'requestId',
        },
        {
            title: 'Approver',
            dataIndex: 'approver',
            key: 'approver',
        },
        {
            title: 'Date Approved',
            dataIndex: 'dateApproved',
            key: 'dateApproved',
        },
        {
            title: 'Status',
            dataIndex: 'status',
            key: 'status',
            render: status => ( <
                Badge status = { status === 'Approved' ? 'success' : 'error' }
                text = { status }
                />
            ),
        },
        {
            title: 'Comments',
            dataIndex: 'comments',
            key: 'comments',
        },
    ];

    return <Table columns = { columns }
    dataSource = { approvals }
    rowKey = "id" / > ;
};

export default ApprovalsTable;
